/* BUTTON - JS */

import React from "react";
import './style.css';


const theme = {
  blue: {
    default: "#2c88d9",
    hover: "#fof"
  }
}

Button.defaultProps = {
  theme: "blue"
};

function Button() {

  function clickMe() {
    alert("You're clicked me !");
  }

  return (
    <button onClick={clickMe}>Button</button>
  )
  
  
}

export default Button;
